# Set GITCOIN_KEY and GITCOIN_SCORER_ID env variables!

import requests
import os
from loguru import logger as logger


def GetGitcoinScore(address: str):
    headers = {
        'accept': 'application/json',
        'X-API-Key': os.environ["GITCOIN_KEY"],
        'Content-Type': 'application/json',
    }
    json_data = {
        'address': address,
        'scorer_id': os.environ["GITCOIN_SCORER_ID"],
    }
    response = requests.post('https://api.scorer.gitcoin.co/registry/submit-passport', headers=headers,
                             json=json_data).json()
    # logger.debug(response)
    score = response['score']
    logger.debug(f"{address} has a score of {score}")
    return score


